import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import HeroSection from './components/HeroSection';
import ServicesSection from './components/ServicesSection';
import AboutUsSection from './components/AboutUsSection';
import VeteransSection from './components/VeteransSection';
import ContactSection from './components/ContactSection';
import Resources from './components/Resources'; // Import the Resources component
import Footer from './components/Footer';
import './index.css'; // Assuming Tailwind CSS is imported here

function App() {
  return (
    <div className="App">
      <Navbar />
      <main>
        <Routes>
          <Route path="/" element={
            <>
              <HeroSection />
              <ServicesSection />
              <AboutUsSection />
              <VeteransSection />
              <ContactSection />
            </>
          } />
          <Route path="/resources" element={<Resources />} /> {/* Add this line */}
          {/* Add other specific routes for additional pages here if needed */}
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
